import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import HomePage from './pages/HomePage';
import CartPage from './pages/CartPage';  // This page can be created similarly
import Header from './components/Header';  // Create a header component for navigation

const App = () => {
  return (
    <Router>
      <Header />
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/cart" element={<CartPage />} />
        {/* Add more routes as needed */}
      </Routes>
    </Router>
  );
};

export default App;
